import React, { useState } from 'react';

const Settings = () => {
    const [accountSettings, setAccountSettings] = useState({
        email: 'user@example.com',
        password: 'password123',
    });

    const [profileSettings, setProfileSettings] = useState({
        username: '',
        bio: '',
    });

    const handleAccountChange = (e) => {
        setAccountSettings({
            ...accountSettings,
            [e.target.name]: e.target.value,
        });
    };

    const handleProfileChange = (e) => {
        setProfileSettings({
            ...profileSettings,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Account Settings:', accountSettings);
        console.log('Profile Settings:', profileSettings);
        alert('Settings saved!');
    };

    // Inline styles for demonstration
    const styles = {
        container: {
            maxWidth: '200vh',
            width: '100%',
            height: '80vh',
            padding: '24px',
            background: '#fff',
            borderRadius: '12px',
            boxShadow: '0 2px 16px rgba(0,0,0,0.08)',
            fontFamily: 'Segoe UI, Arial, sans-serif',
            boxSizing: 'border-box',
            margin: '0 auto',
            overflow: 'auto', // Allow scrolling if content overflows
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'flex-start',
        },
        heading: {
            textAlign: 'center',
            marginBottom: '20px',
            color: '#222',
        },
        section: {
            marginBottom: '20px',
            paddingBottom: '12px',
            borderBottom: '1px solid #eee',
        },
        label: {
            display: 'block',
            marginBottom: '10px',
            color: '#444',
            fontWeight: 500,
        },
        input: {
            width: '100%',
            padding: '6px 8px',
            marginTop: '4px',
            marginBottom: '8px',
            border: '1px solid #ccc',
            borderRadius: '6px',
            fontSize: '15px',
            boxSizing: 'border-box',
        },
        textarea: {
            width: '100%',
            minHeight: '50px',
            padding: '6px 8px',
            marginTop: '4px',
            marginBottom: '8px',
            border: '1px solid #ccc',
            borderRadius: '6px',
            fontSize: '15px',
            boxSizing: 'border-box',
            resize: 'vertical',
        },
        button: {
            display: 'block',
            width: '100%',
            padding: '10px',
            background: '#0078d4',
            color: '#fff',
            border: 'none',
            borderRadius: '6px',
            fontSize: '16px',
            fontWeight: 600,
            cursor: 'pointer',
            marginTop: '14px',
            transition: 'background 0.2s',
        },
        buttonHover: {
            background: '#005fa3',
        },
        sectionTitle: {
            fontSize: '17px',
            marginBottom: '10px',
            color: '#0078d4',
        }
    };

    return (
        <div className="settings-container" style={styles.container}>
            <h1 style={styles.heading}>Settings</h1>
            <form onSubmit={handleSubmit}>
                <div className="account-settings" style={styles.section}>
                    <h2 style={styles.sectionTitle}>Account Settings</h2>
                    <label style={styles.label}>
                        Email:
                        <input
                            style={styles.input}
                            type="email"
                            name="email"
                            value={accountSettings.email}
                            onChange={handleAccountChange}
                        />
                    </label>
                    <label style={styles.label}>
                        Password:
                        <input
                            style={styles.input}
                            type="password"
                            name="password"
                            value={accountSettings.password}
                            onChange={handleAccountChange}
                        />
                    </label>
                </div>

                <div className="profile-settings" style={styles.section}>
                    <h2 style={styles.sectionTitle}>Profile Settings</h2>
                    <label style={styles.label}>
                        Username:
                        <input
                            style={styles.input}
                            type="text"
                            name="username"
                            value={profileSettings.username}
                            onChange={handleProfileChange}
                        />
                    </label>
                    <label style={styles.label}>
                        Bio:
                        <textarea
                            style={styles.textarea}
                            name="bio"
                            value={profileSettings.bio}
                            onChange={handleProfileChange}
                        />
                    </label>
                </div>

                <button
                    type="submit"
                    style={styles.button}
                    onMouseOver={e => (e.currentTarget.style.background = styles.buttonHover.background)}
                    onMouseOut={e => (e.currentTarget.style.background = styles.button.background)}
                >
                    Save Settings
                </button>
            </form>
        </div>
    );
};

export default Settings;
